import Fotos from './Fotos';
import Uri from './Uri';
import Videos from './Videos';

const Homepage = () => {
  return (
    <>
      <div className="Uri_container">
        <Uri />
      </div>
      <div className="websiteContainer">
        <Fotos />
      </div>
      <div className="websiteContainer">
        <Videos />
      </div>
    </>
  );
};
export default Homepage;
